import React from 'react';


class Index extends React.Component {

    render() {
        return (
            <div>
                <h1>I am index page from Class Componenet</h1>
                <a href="/index">Home</a> <br></br>
                <a href="/blogs">Blogs</a>
                <a href="/portfolios">Portfolios</a>
                <a href="/cv">CV</a>
                <a href="/blogs">Blogs</a>

            </div>
        )
    }
}


export default Index
